}.btn-3{width:30%;}.btn-4{width:20%;}.btn{font-size:20px;font-weight:bold;border-radius:10px;border:2px solid blue;padding:1px;margin:4px;transition:background-color 0.3s;height:auto;}.btn:hover{background-color:lightgrey; border-color:lightseagreen;}.arrow{padding-top:10px;}.arrow span{font-size:60px;font-weight:900;line-height:10px;}.day{display:none;margin:0 auto;max-width:500px}</style><body><script>var firstDay=new Date("2024-01-01");var dayMin=224;var dayMax=730;var ms2day=24 * 3600000;var currentDay=Math.floor((new Date()-firstDay) / ms2day);function showDay(day){currentDay=day;document.getElementById('calendar').style.display='none';setDay('block');setBtns('flex');}function setDay(disp){document.getElementById('day' + currentDay).style.display=disp;}function setBtns(disp){document.getElementById('btns').style.display=disp;}function showCalendar(){scrolling=false;setDay('none');setBtns('none');document.getElementById('calendar').style.display='block';}function showPrev(days){scrolling=false;Prev(days);}function Prev(days){var day=currentDay-days;if (day<dayMin) day=dayMin;setDay('none');showDay(day);}function showNext(days){scrolling=false;Next(days);}function Next(days){var day=currentDay + days;if (day>dayMax) day=dayMax;setDay('none');showDay(day);}var scrolling=false;const speed=140;function delay(ms){return new Promise(resolve=>setTimeout(resolve, ms));}async function showForward(){if (!scrolling){scrolling=true;while (scrolling && currentDay<dayMax){Next(1);await delay(speed);}}scrolling=false;}async function showBackward(){if (!scrolling){scrolling=true;while (scrolling && currentDay>dayMin){Prev(1);await delay(speed);}}scrolling=false;}const tolerance=100;var tStart, tEnd;function touchStart(e){tStart=e.touches[0];document.querySelectorAll(".click").forEach(function (el){el.style.display="none";});}function touchMove(e){tEnd=e.touches[0];}async function touchEnd(e){scrolling=false;await delay(speed);var xTravel=tEnd.clientX-tStart.clientX,yTravel=tEnd.clientY-tStart.clientY;var isVertical=xTravel<tolerance && xTravel>-tolerance;if (isVertical){var isSwipeUp=yTravel<-tolerance;if (isSwipeUp) return;var isSwipeDown=yTravel>tolerance;if (isSwipeDown) return;}var isHorizontal=yTravel<tolerance && yTravel>-tolerance;if (isHorizontal){var isSwipeLeft=xTravel<-tolerance;if (isSwipeLeft){e.stopPropagation();showBackward();return;}var isSwipeRight=xTravel>tolerance;if (isSwipeRight){e.stopPropagation();showForward();}}}document.addEventListener("DOMContentLoaded", function (){showDay(currentDay);document.querySelectorAll('.day').forEach(el=>{el.addEventListener('touchstart', touchStart);el.addEventListener('touchmove', touchMove);el.addEventListener('touchend', touchEnd);});});</script><div class=defs><svg><defs><lineargradient id=gradient x1=0% x2=0% y1=0% y2=100%><stop class=stop1 offset=0% /><stop class=stop2 offset=100% /></lineargradient><image height=224 id=moon width=224 xlink:href=data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAGQAAABkCAYAAABw4pVUAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsIAAA7CARUoSoAAACq2SURBVHhezd1NzJ5lmf/xh0LRKlpEwQKFVkAtaIIMZiBjQiZqcE3ERGepbhyNC3fGDRvjzoXRsEGXo6MQMlszaDTRxCj/qTEGfCm0FFBAkWq1WkD/x+fy/j65eW9pCxzJyfl2vP6O4zyv676f56GnbbyC6Y9//OO2aTv//ve/X3b06NE9v/nNby4955xzLjrvvPN2PPzww+eeddZZZ2/duvWsM888c+tf/vKXjX/84x+PHzp06PDwPDZrjxw+fPi3QwcvuOCCfX/4wx/ufu1rX/vr6e+/5pprjqxMvOLoFZWQAXTr7373u3c88cQT7xmAr/vb3/72rieffPKi008/fdtjjz22cemll27oB/SNP/3pTxsXXXTRIqffu3fvxiWXXLKxZcuWDcnZsWOHhC58r3rVqzYmqRu///3vj7zpTW86OPO9o/v70//gNa95zc8nUY8vil4B9LInZADfOpV/zYBzw1Tz9QPo5eeee+7pZ5xxhgQtgE6lb7z61a/eGDA3Dhw4sDH7G3NKNubULMkZHUuiXv/61y+JGH0b27dv39i2bZskLEki//jjj29Mspf5nKDF/Ni5a+bfnpN2+7QfnXbaaS9rcl62hDz00EO75vr48IDxkbPPPvtKFXzfffdtXHHFFUtFA/vIkSMbU70LgH/+858X0O0Bd07Nsk/O+lxTm+sa4CWKHjrwSrI1fI8++ujG6173uiUxdEwy2Pjp8Hx99r8x7cDK1ZeUXvKETEVfNRX8yQHkxgF3+8UXX7wxVbmchDe+8Y0bk6SNuUYW4IEIQAlxEuaZsQAMxJIEbAA7TfR0qqy7upwS+0BPH/14Ja3E4sdD9yTn0Fxpt44PX5n5/61cf0noJUvIJODKuTI+O8F/cII9w/XhmQAEwOmBDcw3v/nNyxi4f/3rXz
